import React from 'react'
import useSound from 'use-sound'
// import heartSound from '../sounds/heartbeat.mp3'

const HeartIcon = () => {

  const [play] = useSound(
    '../sounds/heartbeat.mp3',
    { volume: 0.5 }
  )

  return (
    <i id="ChanceLogo" className="icon" onFocus={e => play(e)} />
  );
}
export default HeartIcon
